            setRooms(res.data.message)
        }
     getOrders()
    },[])
    console.log(rooms)
    return (
        <div>
            <h1>Profile</h1>
            {rooms.map((item)=>(<><h1>{rooms.order_id}</h1>
                                <h2>{rooms.room_id}</h2>
                                <h2>{rooms.price}</h2>
                                </>))}
        </div>
    )
}

export default Profile
